import React from 'react';

const Skincare = () => {
  return (
    <div 
      className="container mx-auto px-4 py-8"
      style={{
        backgroundImage: 'url("/images/home-bg.jpg")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundAttachment: 'fixed'
      }}
    >
      {/* Add some content here to prevent an empty div */}
      <h1 className="text-3xl font-bold text-center text-green-700">Skincare Page</h1>
      <p className="text-center text-gray-700 mt-4">
        Welcome to the skincare section. Here, you'll find tips and natural remedies for healthy skin.
      </p>
    </div>
  );
};

export default Skincare;
